var server = {};
server.config = {};
$(document).ready(function () {
    $('div[data-config] > input[type=hidden]').each(function (index, element) {
        var $element = $(element);
        var result;
        switch ($element.data('type')) {
            case 'bool':
                result = ($element.val() === "true") ? true : false;
                break;
            case 'int':
                result = parseInt($element.val());
                break;
            default:
                result = $element.val();
        }
        server.config[$element.attr('name')] = result;
    });
});;
