app.controller("tourController", ["$scope", "$rootScope", "$route", "$routeParams", "$filter", "$location", "$timeout",
    function ($scope, $rootScope, $route, $routeParams, $filter, $location, $timeout) {
        $rootScope.tourRunning = false;
        $rootScope.tourClicked = function (id) {
            if ($rootScope.tourElementsClicked && $rootScope.tourElementsClicked[id] && $rootScope.tourRunning) {
                $rootScope.tourNext();
                $rootScope.tourElementsClicked[id] = false;
            };
        };
        $rootScope.enjoyhintScriptData = [];
        $rootScope.GetTextForTour = function (language) {
            const texts = {
                en: { next: "Next", exit: "Exit" },
                fa: { next: "بعدی", exit: "خروج" },
                ar: { next: "التالي", exit: "خروج" }
            };
            return texts[language] || texts["fa"];
        };
        $rootScope.addToEnjoyhint = function (selector, checkSelector, timeout, margin, showNext, showSkip, shape, onBeforeStart, description, nextText, skipText) {
            checkSelector = checkSelector || selector;
            if ($(checkSelector).length > 0) {
                $rootScope.enjoyhintScriptData.push({
                    selector: selector,
                    description: description,
                    timeout: timeout,
                    showNext: showNext,
                    showSkip: showSkip,
                    onBeforeStart: onBeforeStart,
                    margin: margin,
                    shape: shape,
                    "nextButton": { className: "", text: nextText || $rootScope.GetTextForTour(server.config.language).next },
                    "skipButton": { className: "", text: skipText || $rootScope.GetTextForTour(server.config.language).exit }
                });
            }
        };

        $rootScope.tourNext = function () {
            if (typeof ($scope.enjoyhintInstance) !== "undefined") {
                $scope.enjoyhintInstance.trigger('next');
            }
        };
        $scope.tourLinksHandle = function () {
            var tourLinks = $("a.tour-link");
            $scope.disableTourClicked = false;
            angular.forEach(tourLinks,
                function (obj) {
                    var href = $(obj).attr("href");
                    var newHref = href.indexOf("?") === -1 ? href + "?tour=1" : href + "&tour=1";
                    $(obj).attr("href", newHref);
                });
        };
        $scope.tourClosed = function () {
            var tourLinks = $("a.tour-link");
            angular.forEach(tourLinks,
                function (obj) {
                    var href = $(obj).attr("href");
                    var newHref = href.replace("?tour=1", "").replace("&tour=1", "");
                    $(obj).attr("href", newHref);
                });
            $timeout(function () {
                $(".modal-header .close").trigger("click");
                $location.search("tour", null);
                $("html,body").animate({ scrollTop: 0 }, "slow");
                $rootScope.tourRunning = false;
                $rootScope.tourAfterEnd();
            });
        };
        $rootScope.tourStart = function () {
            $scope.enjoyhintInstance = new EnjoyHint({
                container: "body",
                onStart: function () {
                    $rootScope.tourRunning = true;
                    $scope.tourLinksHandle();
                    $(".tour-start-icon").hide();
                    $rootScope.tourBeforeStart();
                },
                onEnd: function () {
                    $scope.tourClosed();
                    $(".tour-start-icon").show();
                },
                onSkip: function () {
                    $scope.tourClosed();
                }
            });
            $scope.enjoyhintInstance.set($rootScope.enjoyhintScriptData);
            $scope.enjoyhintInstance.run();
        };
    }
]);
;